package com.xuyuan.cache.oscache.simple;

public class News {

	/**
	 * @uml.property  name="id"
	 */
	private String id;

	public News(String id) {
		this.id = id;
	}

	/**
	 * @return
	 * @uml.property  name="id"
	 */
	public String getId() {
		return id;
	}

	/**
	 * @param id
	 * @uml.property  name="id"
	 */
	public void setId(String id) {
		this.id = id;
	}
	
}
